import React from "react";
import { Link } from "react-router-dom";
import "./DonorOrNGO.css";
function DonorOrNGO() {
  return (
    <div className="container10">
      <p className="option1">SIGN UP</p>
      <Link to="/suD">
        <button className="transaction-list-btn1">DONOR</button>
      </Link>
      <Link to="/suN">
        <button className="transaction-list-btn1">NGO</button>
      </Link>
      <p className="option2">LOG IN</p>
      <Link to="/liD">
        <button className="transaction-list-btn1">DONOR</button>
      </Link>
      <Link to="/liN">
        <button className="transaction-list-btn1">NGO</button>
      </Link>
    </div>
  );
}
export default DonorOrNGO;
